(2, 'Footer Blocks', 'footer_shipping', '<div class="shippingreturns">\r\n<div class="shippingpolicy" style="width: 140px; float: left;"> <h4 style="font-weight: none !important;">Our Offers</h4> <ul class="policy">\r\n<li><a href="#">New products</a></li>\r\n<li><a href="#">Top sellers</a></li>\r\n<li><a href="#">Specials</a></li>\r\n<li><a href="#">Manufacturers</a></li>\r\n<li><a href="#">Suppliers</a></li>\r\n<li><a href="#">Specials</a></li>\r\n<li><a href="#">Service</a></li>\r\n</ul>\r\n</div>\r\n<div class="shippingpolicy" style="width: 150px; float: left;"> <h4 style="font-weight: none !important;">Shipping Info</h4> <ul class="policy">\r\n<li><a href="#">Returns</a></li>\r\n<li><a href="#">Delivery</a></li>\r\n<li><a href="#">Service</a></li>\r\n<li><a href="#">Gift Cards</a></li>\r\n<li><a href="#">Mobile</a></li>\r\n<li><a href="#">Gift Cards</a></li>\r\n<li><a href="#">Manufacturers</a></li></ul></div>\r\n<div class="shippingpolicy" style="width: 150px; float: left;"> <h4 style="font-weight: none !important;">Our Account</h4> <ul class="policy">\r\n<li><a href="#">Your Account</a></li>\r\n<li><a href="#">information</a></li>\r\n<li><a href="#">Addresses</a></li>\r\n<li><a href="#">Discount</a></li>\r\n<li><a href="#">Orders history</a></li>\r\n<li><a href="#">Addresses</a></li>\r\n<li><a href="#">Search Terms</a></li></ul></div>\r\n<div class="shippingpolicy" style="width: 150px; float: left;"> <h4 style="font-weight: none !important;">Our Support</h4> <ul class="policy">\r\n<li><a href="#">Site Map</a></li>\r\n<li><a href="#">Search Terms</a></li>\r\n<li><a href="#">Advanced Search</a></li>\r\n<li><a href="#">Mobile</a></li>\r\n<li><a href="#">Contact Us</a></li>\r\n<li><a href="#">Mobile</a></li>\r\n<li><a href="#">Addresses</a></li></ul></div></div>', '2013-04-25 21:12:24', '2013-04-25 21:12:24', 1),
(3, 'Follow Us', 'follow_us', '<div style="border-top: 1px solid #efefef; padding: 12px 0 0 0;">\r\n<p class="follow_us">Follow Us:</p>\r\n<p class="left"><a class="facebook" href=" http://feedburner.com">&nbsp;</a> <a class="twitter" href="http://twitter.com">&nbsp;</a> <a class="rss" href="http://www.facebook.com">&nbsp;</a></p>\r\n<div class="gift_img"><img src="{{media url="wysiwyg/blanco/gift.png"}}" alt="" /></div>\r\n<div class="phone"><img src="{{media url="wysiwyg/blanco/telephone.png"}}" alt="" /></div>\r\n</div>', '2013-04-25 21:13:19', '2013-04-25 21:13:19', 1),
